import React from 'react'
import ContactKeepers from '../layout/ContactKeeper.png'
import Carousel from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';
const ContactKeeper = () =>  {


        return (      
            <React.Fragment>
                <div className="container">
                    <Carousel
                        plugins={[
                            {
                            resolve: arrowsPlugin,
                            options: {
                                arrowLeft: <button><i class="fas fa-home"></i></button>,
                                arrowLeftDisabled:<button><i class="fas fa-home"></i></button>,
                                arrowRight: <button><i class="fas fa-home"></i></button>,
                                arrowRightDisabled: <button><i class="fas fa-home"></i></button>,
                                addArrowClickHandler: true,
                            }
                            }
                        ]}
                    >
                         <img src={ContactKeepers}/>
                                
                    </Carousel>
                    <p className ="text-center text-primary">
                    This is my first full stack application created for learning the back-end. 
                    I used postman for creating my API and use MongoDB to serve as my Cloud Database
                    </p>
                </div>
            </React.Fragment>
        )
    }


export default ContactKeeper
